import React, { useState, useEffect, useRef } from "react";

import styles from "./Header.module.scss";
import { useHeaderAndNavDimensions } from "./components/Header/layout.jsx";

import tg from "../../media/header/socials/tg.png";
import youtube from "../../media/header/socials/youtube.png";
import vk from "../../media/header/socials/vk.png";


export const HeaderLeft = () => {
    const { contentStyle, headerRef, navRef } = useHeaderAndNavDimensions();

    return (
        <section className={styles.header_left} ref={navRef}>
                <nav>
                    <a href="#">Напишите нам</a>
                    <a href="#">Акции</a>
                    <a href="#" className={styles.live}>
                        <div className={styles.live_circle}></div>Live
                    </a>
                </nav>
                <div className={styles.socials}>
                    <a href="">
                        <img src={tg} alt="" />
                    </a>
                    <a href="">
                        <img src={youtube} alt="" />
                    </a>
                    <a href="">
                        <img src={vk} alt="" />
                    </a>
                </div>
            </section>
    )
}
